import React from 'react';
import TeamInfo from '../../Elements/teamInfo';

const header = (props) => {
    
    const teamInfo = (team) => {
        return team ? (
            <TeamInfo
                team={team}
            />
        ):null;
    }

    const postData = {}

    return (
        <div>
            {teamInfo(props.teamData)}
            {postData(props.date, props.author)}
        </div>
    );
};

export default header;
